import React, { Component } from 'react';
import './App.css';
import catData from './data/catData'
import Card from './components/Card'


class App extends Component {
state={ data:catData}


  render() {
    return this.state.data.map(item=>{
          return <Card itemData={item} />;
          });


  }
}

export default App;
